INSERT INTO `artshow` (`idShow`, `Title`, `Type`, `Description`, `DateAndTimeStart`, `DateAndTimeEnd`) VALUES
(55001, 'Sculture Show', 'White', 'Art is a collaboration between God and the artist, and the less the artist does the better.', '2022-03-09 15:45:00', '2022-03-10 18:00:00'),
(55002, 'Art Models', 'White', 'Art is born of the observation and investigation of nature.', '2022-07-22 09:30:00'),
(66001, 'Abstract show', 'Blue', 'The aim of art is to represent not the outward appearance of things, but their inward significance.', '2022-08-16 21:00:00', '2022-08-17 21:00:00'),
(66002, 'Figurative Art', 'Blue', 'There is no better deliverance from the world than through art; and a man can form no surer bond with it than through art.', '2023-02-14 12:00:00', '2023-03-14 12:00:00'),
(77001, 'Expressionism Art ', 'Green', 'An authentic work of art must start an argument between the artist and his audience.', '2022-12-23 10:00:00', '2023-05-23 10:00:00'),
(77002, 'Early XX Art show', 'Green', 'Art does not exist only to entertain, but also to challenge one to think, to provoke, even to disturb, in a constant search for truth.', '2022-09-28 19:00:00', '2022-11-28 19:00:00'),
(88001, 'Contemporary art ', 'Red', 'Every artist dips his brush in his own soul, and paints his own nature into his pictures.', '2021-12-09 14:30:00', '2022-02-09 14:30:00'),
(88002, 'Surrealism Show', 'Red', 'Art is the desire of a man to express himself, to record the reactions of his personality to the world he lives in.', '2015-06-16 17:30:00', '2015-08-16 17:30:00'),
(99001, 'Post-War Operas', 'Yellow', 'The Post-War Operas wants to show the operas realized during the post war period.', '2016-09-22 16:30:00', '2016-10-22 16:30:00'),
(99002, 'American Modernism', 'Yellow', 'This show has been organised to show the american masterpieces of modernism', '2018-02-27 18:30:00', '2018-03-27 18:30:00');
INSERT INTO `author` (`idAuthor`, `Name`, `Surname`, `BirthYear`, `BirthPlace`, `Biography`) VALUES
(1001, 'Claude', 'Monet', 1840, 'Paris', 'Oscar-Claude Monet (14 November 1840 – 5 December 1926) was a French painter and founder of impressionist painting who is seen as a key precursor to modernism, especially in his attempts to paint nature as he perceived it. During his long career, he was the most consistent and prolific practitioner of impressionism\'s philosophy of expressing one\'s perceptions before nature, especially as applied to plein air (outdoor) landscape painting.\r\nThe term \"Impressionism\" is derived from the title of his painting Impression, soleil levant, exhibited in 1874 (the \"exhibition of rejects\") initiated by Monet and his associates as an alternative to the Salon.\r\n'),
(1002, 'Paul ', 'Cézanne', 1839, 'Aix-en-Provence', 'Paul Cézanne (19 January 1839 – 22 October 1906) was a French artist and Post-Impressionist painter whose work introduced new modes of representation and influenced avant garde artistic movements of the early 20th century. Cézanne is said to have formed the bridge between late 19th-century Impressionism and the early 20th century\'s new line of artistic enquiry, Cubism.'),
(1003, 'Edgar', 'Degas', 1834, 'Paris', 'Edgar Degas (19 July 1834 – 27 September 1917) was a French Impressionist artist famous for his pastel drawings and oil paintings.\r\n\r\nDegas also produced bronze sculptures, prints and drawings. Degas is especially identified with the subject of dance; more than half of his works depict dancers. Although Degas is regarded as one of the founders of Impressionism, he rejected the term, preferring to be called a realist, and did not paint outdoors as many Impressionists did.'),
(1004, 'Édouard ', 'Manet', 1832, 'Paris', 'Édouard Manet (23 January 1832 – 30 April 1883) was a French modernist painter. He was one of the first 19th-century artists to paint modern life, as well as a pivotal figure in the transition from Realism to Impressionism.'),
(1005, 'Georges Pierre', 'Seurat', 1859, 'Paris', 'Georges Pierre Seurat (2 December 1859 – 29 March 1891) was a French post-Impressionist artist. He devised the painting techniques known as chromoluminarism and pointillism and used conté crayon for drawings on paper with a rough surface.'),
(1006, 'Pierre-Auguste', 'Renoir', 1841, 'Limoges', 'Pierre-Auguste Renoir (25 February 1841 – 3 December 1919) was a French artist who was a leading painter in the development of the Impressionist style. As a celebrator of beauty and especially feminine sensuality, it has been said that \"Renoir is the final representative of a tradition which runs directly from Rubens to Watteau.\"'),
(1007, 'Eugène Henri Paul', 'Gauguin', 1848, 'Paris', 'Eugène Henri Paul Gauguin (7 June 1848 – 8 May 1903) was a French Post-Impressionist artist. Unappreciated until after his death, Gauguin is now recognized for his experimental use of colour and Synthetist style that were distinct from Impressionism. Toward the end of his life, he spent ten years in French Polynesia. The paintings from this time depict people or landscapes from that region.'),
(1008, 'Mary', 'Cassatt', 1844, 'Allegheny City', 'Mary Stevenson Cassatt (May 22, 1844 – June 14, 1926) was an American painter and printmaker. She was born in Allegheny, Pennsylvania (now part of Pittsburgh\'s North Side), but lived much of her adult life in France, where she befriended Edgar Degas and exhibited with the Impressionists. Cassatt often created images of the social and private lives of women, with particular emphasis on the intimate bonds between mothers and children.'),
(2001, 'Edward ', 'Hopper', 1882, 'Nyack', 'Edward Hopper (July 22, 1882 – May 15, 1967) was an American realist painter and printmaker. While he is widely known for his oil paintings, he was equally proficient as a watercolorist and printmaker in etching.\r\n\r\nHopper created subdued drama out of commonplace subjects \'layered with a poetic meaning\', inviting narrative interpretations. He was praised for \"complete verity\" in the America he portrayed. His career benefited significantly from his marriage to fellow-artist Josephine Nivison, who contributed much to his work, both as a life-model and as a creative partner.'),
(2002, 'Mark', 'Rothko', 1903, 'Latvia ', 'Mark Rothko (September 25, 1903 – February 25, 1970), was a Latvian-American abstract painter. He is best known for his color field paintings that depicted irregular and painterly rectangular regions of color, which he produced from 1949 to 1970.'),
(2003, 'Paul Jackson', 'Pollock', 1912, 'Cody', 'Paul Jackson Pollock (January 28, 1912 – August 11, 1956) was an American painter and a major figure in the abstract expressionist movement. He was widely noticed for his \"drip technique\" of pouring or splashing liquid household paint onto a horizontal surface, enabling him to view and paint his canvases from all angles. It was called all-over painting and action painting, since he covered the entire canvas and used the force of his whole body to paint, often in a frenetic dancing style. This extreme form of abstraction divided the critics: some praised the immediacy of the creation, while others derided the random effects. In 2016, Pollock\'s painting titled Number 17A was reported to have fetched US$200 million in a private purchase.'),
(2004, 'Grant', 'Wood', 1891, 'Anamosa', 'Grant DeVolson Wood (February 13, 1891  – February 12, 1942) was an American painter and representative of Regionalism, best known for his paintings depicting the rural American Midwest. He is particularly well known for American Gothic (1930), which has become an iconic example of early 20th-century American art.'),
(3001, 'Marc', 'Chagall', 1887, 'Liozna', 'Marc Chagall (6 July 1887 – 28 March 1985) was a Russian-French artist. An early modernist, he was associated with several major artistic styles and created works in a wide range of artistic formats, including painting, drawings, book illustrations, stained glass, stage sets, ceramics, tapestries and fine art prints.'),
(3002, 'Wassily', 'Kandinsky', 1866, 'Moscow', 'Wassily Wassilyevich Kandinsky (16 December 1866 – 13 December 1944) was a Russian painter and art theorist. Kandinsky is generally credited as one of the pioneers of abstraction in western art, possibly after Hilma af Klint. Born in Moscow, he spent his childhood in Odessa, where he graduated at Grekov Odessa Art School. He enrolled at the University of Moscow, studying law and economics. Successful in his profession—he was offered a professorship (chair of Roman Law) at the University of Dorpat (today Tartu, Estonia)—Kandinsky began painting studies (life-drawing, sketching and anatomy) at the age of 30.'),
(3003, 'Henri', 'Matisse', 1869, 'Le Cateau-Cambrésis', 'Henri Émile Benoît Matisse (31 December 1869 – 3 November 1954) was a French visual artist, known for both his use of colour and his fluid and original draughtsmanship. He was a draughtsman, printmaker, and sculptor, but is known primarily as a painter. Matisse is commonly regarded, along with Pablo Picasso, as one of the artists who best helped to define the revolutionary developments in the visual arts throughout the opening decades of the twentieth century, responsible for significant developments in painting and sculpture.'),
(4001, 'Frida', 'Kahlo', 1907, 'Coyoacán', 'Magdalena Carmen Frida Kahlo y Calderón (6 July 1907 – 13 July 1954) was a Mexican painter known for her many portraits, self-portraits, and works inspired by the nature and artifacts of Mexico. Inspired by the country\'s popular culture, she employed a naïve folk art style to explore questions of identity, postcolonialism, gender, class, and race in Mexican society. Her paintings often had strong autobiographical elements and mixed realism with fantasy. In addition to belonging to the post-revolutionary Mexicayotl movement, which sought to define a Mexican identity, Kahlo has been described as a surrealist or magical realist. She is known for painting about her experience of chronic pain.'),
(4002, 'Pablo Ruiz', 'Picasso', 1881, 'Málaga', 'Pablo Ruiz Picasso (25 October 1881 – 8 April 1973) was a Spanish painter, sculptor, printmaker, ceramicist and theatre designer who spent most of his adult life in France. One of the most influential artists of the 20th century, he is known for co-founding the Cubist movement, the invention of constructed sculpture, the co-invention of collage, and for the wide variety of styles that he helped develop and explore. Among his most famous works are the proto-Cubist Les Demoiselles d\'Avignon (1907), and the anti-war painting Guernica (1937), a dramatic portrayal of the bombing of Guernica by German and Italian air forces during the Spanish Civil War.'),
(4003, 'Andy', 'Warhol', 1928, 'Pittsburg ', 'Andy Warhol (August 6, 1928 – February 22, 1987) was an American visual artist, film director, and producer who was a leading figure in the visual art movement known as pop art. His works explore the relationship between artistic expression, advertising, and celebrity culture that flourished by the 1960s, and span a variety of media, including painting, silkscreening, photography, film, and sculpture. Some of his best-known works include the silkscreen paintings Campbell\'s Soup Cans (1962) and Marilyn Diptych (1962), the experimental films Empire (1964) and Chelsea Girls (1966), and the multimedia events known as the Exploding Plastic Inevitable (1966–67).'),
(4004, 'Salvador', 'Dalì', 1904, 'Figueres', 'Salvador Domingo Felipe Jacinto Dalí i Domènech, Marquess of Dalí of Púbol (11 May 1904 – 23 January 1989), known as Salvador Dalí was a Spanish surrealist artist renowned for his technical skill, precise draftsmanship, and the striking and bizarre images in his work.'),
(4005, 'David', 'Hockney', 1937, 'Bradford ', 'David Hockney (born 9 July 1937) is an English painter, draftsman, printmaker, stage designer, and photographer. As an important contributor to the pop art movement of the 1960s, he is considered one of the most influential British artists of the 20th century.'),
(5001, 'Alberto', 'Giacometti', 1901, 'Borgonovo', 'Alberto Giacometti (10 October 1901 – 11 January 1966) was a Swiss sculptor, painter, draftsman and printmaker. Beginning in 1922, he lived and worked mainly in Paris but regularly visited his hometown Borgonovo to see his family and work on his art.'),
(5002, 'François', 'Rodin', 1840, 'Paris', 'François Auguste René Rodin (12 November 1840 – 17 November 1917) was a French sculptor, generally considered the founder of modern sculpture. He was schooled traditionally and took a craftsman-like approach to his work. Rodin possessed a unique ability to model a complex, turbulent, and deeply pocketed surface in clay. He is known for such sculptures as The Thinker, Monument to Balzac, The Kiss, The Burghers of Calais, and The Gates of Hell.'),
(5003, 'Louise', 'Nevelson', 1899, 'Pereiaslav', 'Louise Nevelson (September 23, 1899 – April 17, 1988) was an American sculptor known for her monumental, monochromatic, wooden wall pieces and outdoor sculptures.');
