INSERT INTO `opera` (`idOpera`, `Title`, `Year`, `image`, `Description`, `codAuthor`) VALUES
(1011, 'The Road in Front of Saint-Simeon', 1867, , 'The Road in Front of Saint-Simeon Farm in Winter is an oil-on-canvas snowscape painted by French impressionist Claude Monet. It depicts a snow-covered road in front of a barn, with tracks of a horse cart and various footsteps in the snow. The painting is one of four related works from the winter of 1867, and represents Monet’s earliest series.', 1001);
INSERT INTO `opera` (`idOpera`, `Title`, `Year`, `image`, `Description`, `codAuthor`) VALUES
(1012, 'The Basket of Apples', 1893, , 'The Basket of Apples (French: Le panier de pommes) is a still life oil painting by French artist Paul Cézanne, which he created in 1893. The painting rejected realistic representation in favour of distorting objects to create multiple perspectives. This approach eventually influenced other art movements, including Fauvism and Cubism.', 1002);
INSERT INTO `opera` (`idOpera`, `Title`, `Year`, `image`, `Description`, `codAuthor`) VALUES
(1013, 'The Dancing Class', 1870, , 'The Dancing Class is an oil painting by Edgar Degas. It was painted about 1870. It was the first of Degas\'s \"ballet pictures\". The painting depicts a dancing class at the Paris Opéra. The dancer in the center is Joséphine Gaujelin (or Gozelin).', 1003);
INSERT INTO `opera` (`idOpera`, `Title`, `Year`, `image`, `Description`, `codAuthor`) VALUES
(1014, 'The Absinthe Drinker', 1859, , 'The Absinthe Drinker (French: Le Buveur d\'absinthe) is an early painting by Édouard Manet, executed in 1859, considered to be his first major painting and first original work.', 1004);
INSERT INTO `opera` (`idOpera`, `Title`, `Year`, `image`, `Description`, `codAuthor`) VALUES
(1015, 'A Sunday Afternoon on the Island ', 1886, , 'A Sunday Afternoon on the Island of La Grande Jatte (French: Un dimanche après-midi à l\'Île de la Grande Jatte) was painted from 1884 to 1886 and is Georges Seurat\'s most famous work.[1] A leading example of pointillist technique, executed on a large canvas, it is a founding work of the neo-impressionist movement. Seurat\'s composition includes a number of Parisians at a park on the banks of the River Seine.', 1005);
INSERT INTO `opera` (`idOpera`, `Title`, `Year`, `image`, `Description`, `codAuthor`) VALUES
(1016, 'The Grands Boulevards', 1875, , 'The Grands Boulevards is an oil on canvas painting, which was painted by Pierre-Auguste Renoir in 1875. The painting illustrates a busy Paris boulevard showing the effects of industrialisation and Haussmannisation. It is considered to be Renoir\'s most famous view of Paris.', 1006);
INSERT INTO `opera` (`idOpera`, `Title`, `Year`, `image`, `Description`, `codAuthor`) VALUES
(1017, 'Still Life', 1889, , 'Still Life with Head-Shaped Vase and Japanese Woodcut is an 1889 still life painting by French artist, Paul Gauguin.', 1007);
INSERT INTO `opera` (`idOpera`, `Title`, `Year`, `image`, `Description`, `codAuthor`) VALUES
(1018, 'A Woman and a Girl Driving', 1881, , 'A Woman and a Girl Driving is an oil on canvas painting by American Impressionist Mary Cassatt, created in 1881. It depicts the artist\'s sister Lydia alongside Odile Fèvre, the niece of Edgar Degas, in a carriage traveling through the Bois de Boulogne. Scholars have seen the painting as a representation of growing female autonomy in the Parisian public sphere, where driving one\'s own carriage signified independence.', 1008);
INSERT INTO `opera` (`idOpera`, `Title`, `Year`, `image`, `Description`, `codAuthor`) VALUES
(2011, 'Nighthawks', 1942, , 'Nighthawks is a 1942 oil on canvas painting by Edward Hopper that portrays four people in a downtown diner late at night as viewed through the diner\'s large glass window. The light coming from the diner illuminates a darkened and deserted urban streetscape.', 2001);
INSERT INTO `opera` (`idOpera`, `Title`, `Year`, `image`, `Description`, `codAuthor`) VALUES
(2012, 'Black on Grey', 1970, , 'Untitled (Black on Grey) is an acrylic on canvas painting by Mark Rothko. It is a painting of a black rectangle and a grey rectangle. There is a buildup of thin, translucent layers of differently shaded blacks, which are luminous and warm. The overall effect is strangely ambiguous, neither space nor substance, and Rothko himself described them as touching upon the \'historical sublime\'.', 2002);
INSERT INTO `opera` (`idOpera`, `Title`, `Year`, `image`, `Description`, `codAuthor`) VALUES
(2013, 'The she wolf', 1943, , 'In the early 1940s Pollock, like many of his peers, explored primeval or mythological themes in his work. The wolf in this painting may allude to the animal that suckled the twin founders of Rome, Romulus and Remus, in the myth of the city’s birth. But “She-Wolf came into existence because I had to paint it,” Pollock said in 1944. In an attitude typical of his generation, he added, “Any attempt on my part to say something about it, to attempt explanation of the inexplicable, could only destroy it.” The She-Wolf was featured in Pollock’s first solo exhibition, at Art of This Century gallery in New York in 1943. MoMA acquired the painting the following year, making it the first work by Pollock to enter a museum collection.', 2003);
INSERT INTO `opera` (`idOpera`, `Title`, `Year`, `image`, `Description`, `codAuthor`) VALUES
(2014, 'Sentimental Ballad', 1940, , 'Sentimental Ballad is a 1940 painting by the American artist Grant Wood. It depicts a group of singing men in a bar.\r\n\r\n', 2004);
INSERT INTO `opera` (`idOpera`, `Title`, `Year`, `image`, `Description`, `codAuthor`) VALUES
(3011, 'Bella with White Collar', 1917, , 'Bella with White Collar (Bella au col blanc) is a painting done by Belarusian-French artist Marc Chagall in 1917. It is a portrait of Bella Rosenfeld Chagall, Chagall\'s wife at the time. The two tiny figures at the bottom are thought to represent the artist and the couple\'s daughter, Ida.', 3001);
INSERT INTO `opera` (`idOpera`, `Title`, `Year`, `image`, `Description`, `codAuthor`) VALUES
(3012, 'Points', 1920, , 'A point is a small bit of colour put by the artist on the canvas. It is neither a geometric point nor a mathematical abstraction; it is extension, form and colour. This form can be a square, a triangle, a circle, a star or something more complex. The point is the most concise form but, according to its placement on the basic plane, it will take a different tonality. It can be isolated or resonate with other points or lines.', 3002);
INSERT INTO `opera` (`idOpera`, `Title`, `Year`, `image`, `Description`, `codAuthor`) VALUES
(3013, 'Woman with a Hat', 1905, , 'Woman with a Hat (French: La femme au chapeau) is a painting by Henri Matisse. An oil on canvas, it depicts Matisse\'s wife, Amelie. It was painted in 1905 and exhibited at the Salon d\'Automne during the fall of the same year, along with works by André Derain, Maurice de Vlaminck and several other artists known as \"Fauves\".', 3003);
INSERT INTO `opera` (`idOpera`, `Title`, `Year`, `image`, `Description`, `codAuthor`) VALUES
(4011, 'What the Water Gave Me', 1938, , 'What the Water Gave Me (Lo que el agua me dio in Spanish) is an oil painting by Frida Kahlo that was completed in 1938. It is sometimes referred to as What I Saw in the Water.', 4001);
INSERT INTO `opera` (`idOpera`, `Title`, `Year`, `image`, `Description`, `codAuthor`) VALUES
(4012, 'Massacre in Korea', 1951, , 'Massacre in Korea (French: Massacre en Corée) is an expressionistic painting completed on 18 January 1951 by Pablo Picasso. It is Picasso\'s third anti-war painting and depicts a scene of a massacre of a group of naked women and children by a firing squad. It has been considered to be a condemnation of American intervention in the Korean War.', 4002);
INSERT INTO `opera` (`idOpera`, `Title`, `Year`, `image`, `Description`, `codAuthor`) VALUES
(4013, 'Self-Portrait', 1986, , 'Self-Portrait is a 1986 work by the American artist Andy Warhol. The portrait is in a camouflage-patterned foreground with a black background.', 4003);
INSERT INTO `opera` (`idOpera`, `Title`, `Year`, `image`, `Description`, `codAuthor`) VALUES
(4014, 'The First Days of Spring', 1929, , 'The First Days of Spring is an oil an collage on panel painting by the Spanish surrealist Salvador Dalí, created in 1929.', 4004);
INSERT INTO `opera` (`idOpera`, `Title`, `Year`, `image`, `Description`, `codAuthor`) VALUES
(4015, 'Mr and Mrs Clark and Percy', 1971, , 'Mr and Mrs Clark and Percy is a painting by the British artist David Hockney. Painted between 1970 and 1971, it depicts the fashion designer Ossie Clark and the textile designer Celia Birtwell in their flat in Notting Hill Gate shortly after their wedding, with one of the couple\'s cats on Clark\'s knee. The white cat depicted in the painting was Blanche; Percy was another of their cats, but Hockney thought \"Percy\" made a better title.', 4005);
INSERT INTO `opera` (`idOpera`, `Title`, `Year`, `image`, `Description`, `codAuthor`) VALUES
(5011, 'The Man with the Finger', 1947, , 'L\'Homme au doigt ( \"The Man with the Finger\"; also called Pointing Man or Man Pointing) is a 1947 bronze sculpture by Alberto Giacometti', 5001);
INSERT INTO `opera` (`idOpera`, `Title`, `Year`, `image`, `Description`, `codAuthor`) VALUES
(5012, 'The Thinker', 1904, , 'The Thinker (French: Le Penseur) is a bronze sculpture by Auguste Rodin, usually placed on a stone pedestal. The work depicts a nude male figure of heroic size sitting on a rock. He is seen leaning over, his right elbow placed on his left thigh, holding the weight of his chin on the back of his right hand. The pose is one of deep thought and contemplation, and the statue is often used as an image to represent philosophy.', 5002);
INSERT INTO `opera` (`idOpera`, `Title`, `Year`, `image`, `Description`, `codAuthor`) VALUES
(5013, 'Sky Cathedral', 1958, , 'Sky Cathedral consists of boxes stacked against a wall, each compartment filled with wooden scraps including moldings, dowels, spindles, and furniture parts. Nevelson then covered the entire assemblage with black paint, both unifying the composition and obscuring the individual objects. She once explained her fascination with the color black: “When I fell in love with black, it contained all color. It wasn’t a negation of color. It was an acceptance. Because black encompasses all colors. Black is the most aristocratic color of all. … You can be quiet and it contains the whole thing.”', 5003);
